// Native modules import
import React, { Component } from "react";

// Personal modules import

class OnePost extends Component {
  state = {};
  render() {
    return (
      <div>
        <h2>One Post</h2>
        {this.props.match.params.postId}
      </div>
    );
  }
}

export default OnePost;
